import React, { Component } from 'react';
import PropTypes from 'prop-types'

class Products extends Component {
  constructor () {
    super();
    this.state = {
      name: [],
      price: [],
      description: [],
    };
  }

  componentDidMount(){

    fetch('http://localhost:28071/api/items')
    .then(results => {
      return results.json();
    }).then(data => {
      let name = data.results.map((name) => {
        <div>
        <h1>name={name} </h1>
        </div>
      })
    })
  }

}

export default Products;
